import React, { useState, useEffect } from "react";
import styled from "styled-components";
import { TYPE } from 'theme'

interface Props {
  stringList: string[];
}

const StringsList: React.FC<Props> = ({ stringList }) => {
  return (
    <>
    <TYPE.H4>All strings:</TYPE.H4>
    <ListContainer>
      {stringList.map((str) => (
        <li> {str} </li>
      ))}
    </ListContainer>
    </>
  );
};

const ListContainer = styled.ul`
  list-style: none;
  padding: 0;
`;

export default StringsList;
